import { createGlobalStyle } from 'styled-components';

import TheRickon from './TheRickon.ttf';

export default createGlobalStyle`
    @font-face {
        font-family: 'TheRickon';
        src: local('TheRickon'),
        url(${TheRickon.ttf}) format('truetype'),
        font-weight: 300;
        font-style: normal;
    }
`;
